import React from "react";
import playerImage from "../images/cowboy.png";

const Player = ({ q, r }) => {
  const playerStyle = {
    position: "absolute",
    width: "50px",
    height: "50px",
    backgroundImage: `url(${playerImage})`,
    backgroundSize: "cover",
    left: q * 20 + 10,
    top: r * 20 + 10,
  };

  return <div style={playerStyle}></div>;
};

export default Player;
